import React from 'react'
import { Typography } from '@material-ui/core'
import { makeStyles } from '@material-ui/core/styles'
import BathRobes from '../images/BathRobes.jpg'
import BathTowels from '../images/BathTowels.jpg'
import BedLinens from '../images/BedLinens.jpg'
import HomeFragrances from '../images/HomeFragrances.jpg'

const useStyles = makeStyles({
    ShopContainer: {
        width: "70%",
        margin: "auto",
        height: "150px",
        display: "flex",
        flexDirection: "column",
        columnCount: "2"
    },
    ShopBox: {
        backgroundColor: "black",
        width: "50%",
        height: "550px"
    },
    ShopImage: {
        width: "100%",
        height: "100%",
        objectFit: "cover"
    }
});

export default function HomeShop() {
    const classes = useStyles();
    return (
        <div className={classes.ShopContainer}>
            <div className={classes.ShopBox}>
                <img src={BedLinens} alt="" className={classes.ShopImage} />
            </div>
            <div className={classes.ShopBox}>
                <img src={BathTowels} alt="" className={classes.ShopImage} />
            </div>
            <div className={classes.ShopBox}>
                <img src={BathRobes} alt="" className={classes.ShopImage} />
            </div>
            <div className={classes.ShopBox}>
                <img src={BathTowels} alt="" className={classes.ShopImage} />
            </div>
        </div>
    )
}
